import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Box,
  Alert,
  CircularProgress
} from '@mui/material';

const AddClassroomDialog = ({ open, onClose, onClassroomAdded }) => {
  const [newClassroom, setNewClassroom] = useState({
    name: '',
    capacity: 30,
    facilities: '',
    building: 'Main',
    floor: '1',
    type: 'Lecture Hall'
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (field) => (e) => {
    setNewClassroom({ ...newClassroom, [field]: e.target.value });
    setError(''); // Clear error when user starts typing
  };

  const handleAddClassroom = async () => {
    // Validation
    if (!newClassroom.name || !newClassroom.capacity) {
      setError('Please fill in all required fields');
      return;
    }

    if (newClassroom.capacity < 1) {
      setError('Capacity must be at least 1');
      return;
    }

    setLoading(true);
    setError('');

    try {
      // Call the parent component's function to handle the API call
      await onClassroomAdded(newClassroom);

      // Reset form and close dialog
      setNewClassroom({
        name: '',
        capacity: 30,
        facilities: '',
        building: 'Main',
        floor: '1',
        type: 'Lecture Hall'
      });
      setError('');
      onClose();

    } catch (error) {
      console.error('Error adding classroom:', error);
      setError(error.message || 'Failed to add classroom. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleClose = () => {
    setNewClassroom({
      name: '',
      capacity: 30,
      facilities: '',
      building: 'Main',
      floor: '1',
      type: 'Lecture Hall'
    });
    setError('');
    setLoading(false);
    onClose();
  };

  return (
    <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
      <DialogTitle>Add New Classroom</DialogTitle>
      <DialogContent>
        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        <Box sx={{ pt: 1 }}>
          <TextField
            fullWidth
            label="Classroom Name *"
            margin="normal"
            value={newClassroom.name}
            onChange={handleInputChange('name')}
            disabled={loading}
          />

          <TextField
            fullWidth
            label="Capacity *"
            margin="normal"
            type="number"
            value={newClassroom.capacity}
            onChange={handleInputChange('capacity')}
            disabled={loading}
            inputProps={{ min: 1 }}
          />

          <TextField
            fullWidth
            label="Facilities"
            margin="normal"
            value={newClassroom.facilities}
            onChange={handleInputChange('facilities')}
            disabled={loading}
            placeholder="e.g., Projector, Whiteboard, AC"
          />

          <FormControl fullWidth margin="normal" disabled={loading}>
            <InputLabel>Building</InputLabel>
            <Select
              value={newClassroom.building}
              label="Building"
              onChange={handleInputChange('building')}
            >
              <MenuItem value="Main">Main Building</MenuItem>
              <MenuItem value="Science">Science Building</MenuItem>
              <MenuItem value="Engineering">Engineering Building</MenuItem>
              <MenuItem value="Library">Library Building</MenuItem>
            </Select>
          </FormControl>

          <FormControl fullWidth margin="normal" disabled={loading}>
            <InputLabel>Floor</InputLabel>
            <Select
              value={newClassroom.floor}
              label="Floor"
              onChange={handleInputChange('floor')}
            >
              <MenuItem value="1">1st Floor</MenuItem>
              <MenuItem value="2">2nd Floor</MenuItem>
              <MenuItem value="3">3rd Floor</MenuItem>
              <MenuItem value="4">4th Floor</MenuItem>
            </Select>
          </FormControl>

          <FormControl fullWidth margin="normal" disabled={loading}>
            <InputLabel>Type</InputLabel>
            <Select
              value={newClassroom.type}
              label="Type"
              onChange={handleInputChange('type')}
            >
              <MenuItem value="Lecture Hall">Lecture Hall</MenuItem>
              <MenuItem value="Lab">Laboratory</MenuItem>
              <MenuItem value="Seminar Room">Seminar Room</MenuItem>
              <MenuItem value="Conference Room">Conference Room</MenuItem>
            </Select>
          </FormControl>
        </Box>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} disabled={loading}>
          Cancel
        </Button>
        <Button 
          variant="contained" 
          onClick={handleAddClassroom}
          disabled={loading}
          startIcon={loading ? <CircularProgress size={20} /> : null}
        >
          {loading ? 'Adding...' : 'Add Classroom'}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default AddClassroomDialog;
